    { argument: 3, value: 30 },
];
const useStyles = makeStyles({
    bold: {
        fontWeight: "bold"
    },
})
const StatsCharts = () => {
    const classes = useStyles();

    return (
        <Spacer variant="vertical">
            <Typography component="h2" variant="h5" className={classes.bold}>
